import React from "react";
import {Button, TextField} from "@material-ui/core";

export default function Search() {
  return (
    <div>
      <TextField id="filled-basic" label="Filled" variant="filled" />
      <Button variant="outlined" color="primary">
        SEARCH
      </Button>
    </div>
  );
}
